import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import NavBar from './NavBar';

class App extends Component {
  render() {
    return (
      <div className="App">
      <NavBar style={{display:"flex", flexDirection:"row"}} />
      <h1>Hello</h1>
      </div>
    );
  }
}

export default App;
